import { useEffect, useState } from 'react';
import axios, { AxiosResponse } from 'axios';
import React from 'react';
import { style } from 'typestyle';

export function Dashboard() {
    const [companies, setCompanies] = useState<{ name: string }[] | undefined>();
    useEffect(() => {
        axios.get('api/company').then((r: AxiosResponse<{ companies: { name: string }[] }>) => {
            console.log(r);
            setCompanies(r.data.companies);
        });
    }, []);
    //todo add a spinner
    if (typeof companies === 'undefined') return <div className="App">Nothing here</div>;

    return <div className={style({ color: 'red' })}>{companies.map((company) => company.name)}</div>;
}
